class ToggleUpvote{constructor(t){this.toggler=t,this.toggleUpvote()}toggleUpvote(){$(this.toggler).click((function(t){t.preventDefault();let e=this;$.ajax({type:"POST",url:$(e).attr("href")}).done((function(t){let o=parseInt($(e).attr("data-upvotes"));console.log("Data*****",t),1==t.data.deleted?o-=1:o+=1,$(e).attr("data-upvotes",o),$(e).html(`${o} <i class="fas fa-arrow-up"></i>`)})).fail((function(t){console.log("error in completing the request",t)}))}))}}